import React from "react";
import { StyleSheet, Text, View } from "react-native";

export default function Navbar() {
  return (
    <View style={styles.container}>
      <Text>Home</Text>
      <Text>Login</Text>
      <Text>User Details</Text>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    marginTop: 50,
    position: "absolute",
    top: 0,
    left: 0,
    right: 0,
    height: 44,
    display: "flex",
    flexDirection: "row",
    backgroundColor: "#7fffd4",
    padding: 10,

    paddingTop: 40,
  },
});
